import ReactDOM from 'react-dom';


const App = () => {
    const button = "click me!";
    return (
    <div>

        <label for="name" className="label"> Enter e-mail</label>
        <input type="text" id="name" />
        <button style={{backgroundColor:'red', color:'white'}}>
            {button}
            </button>


    </div>
    )
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
